import React, { useState } from 'react';

function App() {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    phoneNumber: '',
    email: '',
    guess: '',
    code: ''
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Submitted Form Data:', formData);
  };

  return (
    <div className="min-h-screen bg-black text-white flex items-center justify-center">
      <form
        onSubmit={handleSubmit}
        className="bg-zinc-900 p-10 rounded-2xl shadow-md w-full max-w-md"
      >
        <h1 className="text-3xl font-bold text-[#92BC56] mb-6 text-center">
          Spidr Air Fryer Interest Form
        </h1>

        <input
          type="text"
          name="firstName"
          placeholder="First Name"
          onChange={handleChange}
          className="w-full p-3 mb-4 rounded-md bg-black border border-zinc-700 focus:outline-none focus:ring-2 focus:ring-[#92BC56]"
        />
        <input
          type="text"
          name="lastName"
          placeholder="Last Name"
          onChange={handleChange}
          className="w-full p-3 mb-4 rounded-md bg-black border border-zinc-700 focus:outline-none focus:ring-2 focus:ring-[#92BC56]"
        />
        <input
          type="tel"
          name="phoneNumber"
          placeholder="Phone Number"
          onChange={handleChange}
          className="w-full p-3 mb-4 rounded-md bg-black border border-zinc-700 focus:outline-none focus:ring-2 focus:ring-[#92BC56]"
        />
        <input
          type="email"
          name="email"
          placeholder="Email Address"
          onChange={handleChange}
          className="w-full p-3 mb-4 rounded-md bg-black border border-zinc-700 focus:outline-none focus:ring-2 focus:ring-[#92BC56]"
        />
        <input
          type="number"
          name="guess"
          placeholder="Guess the Air Fryerâ€™s Cost ($)"
          onChange={handleChange}
          className="w-full p-3 mb-4 rounded-md bg-black border border-zinc-700 focus:outline-none focus:ring-2 focus:ring-[#92BC56]"
        />
        <input
          type="text"
          name="code"
          placeholder="####-####-####-####"
          onChange={handleChange}
          className="w-full p-3 mb-6 rounded-md bg-black border border-zinc-700 focus:outline-none focus:ring-2 focus:ring-[#92BC56]"
        />

        <button
          type="submit"
          className="w-full bg-[#92BC56] text-black py-3 rounded-md font-semibold hover:bg-[#7ea847] transition"
        >
          Submit
        </button>
      </form>
    </div>
  );
}

export default App;
